import React from "react";
import Sidebar from "../Sidebar/Sidebar";
import * as S from "./PageLayout.styles";

const PageLayout = ({ children }) => {
  return (
    <S.Layout>
      <Sidebar />
      <S.LayoutContent>
        <S.Content>
          <div>{children}</div>
        </S.Content>
      </S.LayoutContent>
    </S.Layout>
  );
};

export default PageLayout;
